import React from 'react';




function Chracterstics({info,pokemonkey}) {
	var pokemoninfo = {}
    info.forEach((pokemon)=>{
    	pokemoninfo[pokemon.id] = pokemon;
    })
    var pokemon = pokemoninfo[pokemonkey];
    console.log(pokemon)
	return (
		<div>
		    {pokemon.id}

		</div>
	)
}
















export default Chracterstics;
